

<!DOCTYPE html>
<html class="writer-html5" lang="en" data-content_root="./">
<head>
  <meta charset="utf-8" /><meta name="viewport" content="width=device-width, initial-scale=1" />

  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Page not found Scikit-learn-intelex </title>

</head>

<body class="wy-body-for-nav"> 
<div id="404message"></div>
</body>
    <script type="text/javascript">
        var available_versions = {};
        fetch("/scikit-learn-intelex/versions.json").then(response => response.text()).then(respText=> available_versions = JSON.parse(respText));
        var url = window.location.href;
        const d = document.getElementById("404message");
        let para = document.createElement("p");
        para.innerHTML = "URL " + url + " doesn't exist.<br>"
        d.append(para);
        for (const item of available_versions){
          let new_p = document.createElement("p");
          new_p.innterHTML = '<b>' + item.name + ':</b> <a href="' + item.url + '">' + item.url + '</a>';
          d.append(new_p);
        }
        
        
    </script>
</html>
